const OpenSans300 = `@font-face { font-family: 'Open Sans'; font-style: normal; font-weight: 300; src: local('Open Sans Light'), local('OpenSans-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const OpenSans300italic = `@font-face { font-family: 'Open Sans'; font-style: italic; font-weight: 300; src: local('Open Sans Light Italic'), local('OpenSans-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
